import React from 'react'
import Header from '../../components/Header'


const FavoritesList = (props) => {
    let list = JSON.parse(localStorage.getItem("favoriteList"))
    return (
        <div>
            <Header />

            <h3>My Favorites</h3>
            <p>Add favorite</p>
            {console.log(list)}
            list.map()
        </div>
    )
}

export default FavoritesList
